// Script para processar dados de horas, empresas e colaboradores
const processedData = {
    // Visão Geral das Horas
    totalHorasEstimadas: 0,
    totalHorasReais: 0,
    desvioTotalHoras: 0,
    totalAtividadesConcluidas: 0,
    totalAtividadesEmAndamento: 0,
    totalAtividadesNaoIniciadas: 0,

    // Detalhes das Horas Lançadas
    detalhesHoras: [],

    // Visão Geral de Empresas
    totalEmpresas: 0,
    empresasCadastradas: [],

    // Visão Geral de Colaboradores
    totalColaboradores: 0,
    colaboradoresAtivos: 0,
    colaboradoresPorTipo: {},
    detalhesColaboradores: [],

    // Horas por Responsável e Tipo
    horasPorResponsavel: {},
    horasPorTipoAtividade: {},
    horasPorProjeto: {},
    horasPorCliente: {},
    custoTotalPorResponsavel: {}, // Novo campo para custo total por responsável
    custoTotalPorTipoAtividade: {}, // Novo campo para custo total por tipo de atividade
    custoTotalPorProjeto: {}, // Novo campo para custo total por projeto
    custoTotalPorCliente: {}, // Novo campo para custo total por cliente

    // Dados brutos (opcional, para depuração)
    rawDadosHoras: [],
    rawDadosEmpresas: [],
    rawDadosColaboradores: []
};

console.log('Total de inputs recebidos:', $input.all().length);

// Mapas para armazenar dados por ID para fácil acesso
const dadosHorasMap = new Map();
const dadosEmpresasMap = new Map();
const dadosColaboradoresMap = new Map();

// --- PRIMEIRA PASSAGEM: Coletar e organizar todos os dados brutos e preencher os mapas ---
// Isso garante que todos os colaboradores e empresas estejam disponíveis antes de processar as horas
for (const item of $input.all()) {
    const data = item.json.data; // Acessa diretamente o objeto 'data'

    if (data.dados_horas && Array.isArray(data.dados_horas)) {
        // Adiciona dados de horas ao mapa de horas e à lista bruta
        for (const hora of data.dados_horas) {
            dadosHorasMap.set(hora.id, hora);
            processedData.rawDadosHoras.push(hora);
        }
    }

    if (data.dados_empresas && Array.isArray(data.dados_empresas)) {
        // Adiciona dados de empresas ao mapa de empresas e à lista bruta
        for (const empresa of data.dados_empresas) {
            dadosEmpresasMap.set(empresa.id, empresa);
            processedData.rawDadosEmpresas.push(empresa);
            processedData.totalEmpresas++;
            processedData.empresasCadastradas.push({
                id: empresa.id,
                razao_social: empresa.razao_social,
                cnpj: empresa.cnpj
            });
        }
    }

    if (data.dados_colaboradores && Array.isArray(data.dados_colaboradores)) {
        // Adiciona dados de colaboradores ao mapa de colaboradores e à lista bruta
        for (const colaborador of data.dados_colaboradores) {
            dadosColaboradoresMap.set(colaborador.id, colaborador);
            processedData.rawDadosColaboradores.push(colaborador);
            processedData.totalColaboradores++;
            if (colaborador.status) {
                processedData.colaboradoresAtivos++;
            }
            // Conta colaboradores por tipo
            processedData.colaboradoresPorTipo[colaborador.tipo] = (processedData.colaboradoresPorTipo[colaborador.tipo] || 0) + 1;

            // Adiciona detalhes completos do colaborador
            processedData.detalhesColaboradores.push({
                id: colaborador.id,
                nome: colaborador.nome,
                email: colaborador.email,
                tipo: colaborador.tipo,
                status: colaborador.status,
                valor_hora_resolv_ai: colaborador.valor_hora_resolv_ai,
                valor_hora_resolv: colaborador.valor_hora_resolv,
                valor_hora_amigu: colaborador.valor_hora_amigu
            });
        }
    }
}

// --- SEGUNDA PASSAGEM: Processar os dados de horas, agora que todos os colaboradores estão carregados ---
for (const horas of dadosHorasMap.values()) { // Itera sobre os valores do mapa de horas
    let estimatedHours = parseFloat(horas.estimatedhours || 0);
    let actualHours = parseFloat(horas.actualhours || 0);

    // Processa horas quebradas se existirem e adiciona às horas reais
    if (horas.hora_quebrada_1) {
        const parts = horas.hora_quebrada_1.split(',');
        if (parts.length === 2) {
            actualHours += parseFloat(parts[1] || 0);
        }
    }
    if (horas.hora_quebrada_2) {
        const parts = horas.hora_quebrada_2.split(',');
        if (parts.length === 2) {
            actualHours += parseFloat(parts[1] || 0);
        }
    }

    // Recalcula o desvio após adicionar as horas quebradas
    const deviation = actualHours - estimatedHours;

    // Atualiza totais globais de horas
    processedData.totalHorasEstimadas += estimatedHours;
    processedData.totalHorasReais += actualHours;
    processedData.desvioTotalHoras += deviation; // Soma o desvio de cada atividade para o desvio total

    // Contagem de status de atividades
    if (horas.status === 'CONCLUÍDO') {
        processedData.totalAtividadesConcluidas++;
    } else if (horas.status === 'EM ANDAMENTO') {
        processedData.totalAtividadesEmAndamento++;
    } else if (horas.status === 'NÃO INICIADO') {
        processedData.totalAtividadesNaoIniciadas++;
    }

    // Encontra informações do colaborador responsável
    const colaboradorInfo = Array.from(dadosColaboradoresMap.values()).find(colab => colab.nome === horas.responsible);
    let valorHoraResponsavel = 0;
    let custoTotal = 0;

    if (colaboradorInfo) {
        // Determina o valor da hora do responsável com base na empresa contratante
        switch (horas.company) {
            case 'Resolv Ai':
                valorHoraResponsavel = colaboradorInfo.valor_hora_resolv_ai || 0;
                break;
            case 'Resolv':
                valorHoraResponsavel = colaboradorInfo.valor_hora_resolv || 0;
                break;
            case 'Instituto Amigu':
                valorHoraResponsavel = colaboradorInfo.valor_hora_amigu || 0;
                break;
            default:
                // Fallback para valor_hora_resolv_ai se a empresa não for reconhecida ou o valor específico for nulo
                valorHoraResponsavel = colaboradorInfo.valor_hora_resolv_ai || 0;
        }
        // Calcula o custo total da atividade
        custoTotal = actualHours * valorHoraResponsavel;
    }

    // Adiciona detalhes da hora processada
    processedData.detalhesHoras.push({
        id: horas.id,
        tipo: horas.type,
        descricao: horas.description,
        status: horas.status,
        projeto: horas.project,
        cliente: horas.client,
        empresaContratante: horas.company,
        responsavel: horas.responsible,
        emailResponsavel: colaboradorInfo ? colaboradorInfo.email : 'N/A',
        dataConclusao: horas.completiondate,
        dataInicio: horas.startdate,
        dataFim: horas.enddate,
        horasEstimadas: estimatedHours,
        horasReais: actualHours,
        desvio: deviation,
        timestamp: horas.timestamp,
        lancadoPor: horas.lacado_por,
        valorHoraResponsavel: valorHoraResponsavel, // Novo campo: valor da hora do responsável
        custoTotal: custoTotal // Novo campo: custo total da atividade
    });

    // Atualiza horas e custos agregados por responsável
    processedData.horasPorResponsavel[horas.responsible] = (processedData.horasPorResponsavel[horas.responsible] || { estimada: 0, real: 0 });
    processedData.horasPorResponsavel[horas.responsible].estimada += estimatedHours;
    processedData.horasPorResponsavel[horas.responsible].real += actualHours;
    processedData.custoTotalPorResponsavel[horas.responsible] = (processedData.custoTotalPorResponsavel[horas.responsible] || 0) + custoTotal;

    // Atualiza horas e custos agregados por tipo de atividade
    processedData.horasPorTipoAtividade[horas.type] = (processedData.horasPorTipoAtividade[horas.type] || { estimada: 0, real: 0 });
    processedData.horasPorTipoAtividade[horas.type].estimada += estimatedHours;
    processedData.horasPorTipoAtividade[horas.type].real += actualHours;
    processedData.custoTotalPorTipoAtividade[horas.type] = (processedData.custoTotalPorTipoAtividade[horas.type] || 0) + custoTotal;

    // Atualiza horas e custos agregados por projeto
    if (horas.project) {
        processedData.horasPorProjeto[horas.project] = (processedData.horasPorProjeto[horas.project] || { estimada: 0, real: 0 });
        processedData.horasPorProjeto[horas.project].estimada += estimatedHours;
        processedData.horasPorProjeto[horas.project].real += actualHours;
        processedData.custoTotalPorProjeto[horas.project] = (processedData.custoTotalPorProjeto[horas.project] || 0) + custoTotal;
    }

    // Atualiza horas e custos agregados por cliente
    if (horas.client) {
        processedData.horasPorCliente[horas.client] = (processedData.horasPorCliente[horas.client] || { estimada: 0, real: 0 });
        processedData.horasPorCliente[horas.client].estimada += estimatedHours;
        processedData.horasPorCliente[horas.client].real += actualHours;
        processedData.custoTotalPorCliente[horas.client] = (processedData.custoTotalPorCliente[horas.client] || 0) + custoTotal;
    }
}

console.log('=== RESULTADO FINAL DO PROCESSAMENTO ===');
console.log(JSON.stringify(processedData, null, 2));

return [{ json: processedData }];
